function showMap(a,b){for(var c=0,d=0,e=0;e<a.length;e++)c+=a[e].lat,d+=a[e].lng;var f={zoom:6,center:new google.maps.LatLng(c,d),zoomControl:!0,mapTypeControl:!1,mapTypeId:google.maps.MapTypeId.ROADMAP},g=new google.maps.Map(document.getElementById("map"),f);for(e=0;e<a.length;e++){new google.maps.Marker({position:new google.maps.LatLng(a[e].lat,a[e].lng),map:g,icon:b})}}